import os
from unittest import mock
from unittest.mock import patch

import boto3
from fastapi.testclient import TestClient
from main import app
from moto import mock_s3

# Ejemplo con ruta relativa
current_directory = os.path.dirname(os.path.abspath(__file__))

client = TestClient(app)

@mock_s3
def test_generate_base_64_with_valid_body_response_base_64_file_200():
    # Configura el bucket y la clave en S3
    bucket_name = 'test-bucket'
    key = 'test-key'
    mock_s3().start()
    s3 = boto3.client('s3')
    s3.create_bucket(Bucket=bucket_name)

    with open(os.path.abspath(f'{current_directory}/data_test/30716829436_202312.txt'), 'r', encoding='utf-8') as file:
        data_content = file.read()

    s3.put_object(Bucket=bucket_name, Key=key, Body=data_content)

    with patch('boto3.client') as mock_client:
        mock_s3_client = mock_client.return_value
        mock_s3_client.get_object.return_value = {
            'Body': mock.MagicMock()  # Mockear el objeto de streaming
        }
        mock_s3_client.get_object.return_value['Body'].read.return_value = data_content.encode('utf-8')

        item_data = {
            "taxpayerId": 20122226949,
            "period": 202312,
            "taxId": 921,
            "withholdingGroupingId": "285"
        }

        response = client.post("/v1/certificates", json=item_data)

        assert response.status_code == 200

        assert response.json() == {
            "filename": '20122226949_921_202312.pdf',
            "base64": ''
        }
